import React from "react";
import { NavLink } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <NavLink ac to="/">About </NavLink>
      <NavLink ac to="/contact">Contact</NavLink>
    </div>
  );
}

export default Navbar;
